    <script>
gsap.registerPlugin(ScrollTrigger);

// Select the mask path and turbulence filter elements
const maskPath = document.querySelector('#maskPath');
const turbulence = document.querySelector('#turbulence');
const arrow = document.querySelector('.arrow'); // Assuming there's an element with class 'arrow'

// Initially hide the arrow and image (fully hidden)
gsap.set(arrow, { opacity: 0, visibility: 'hidden' });
gsap.set(maskPath, { attr: { d: "M 0 280 Q 500 620.2128 0 280 Q 500 -34.0426 0 280" } }); // Hide the mask by resetting the path

// Set a delay after page load before starting the animation
gsap.delayedCall(3, () => {
  // Reveal the arrow after a delay, fully visible with smooth animation
  gsap.to(arrow, {
    opacity: 1,
    visibility: 'visible',
    duration: 1, // Duration for fade-in effect
    ease: "power2.inOut",
  });

  // Animate the mask path to fully reveal the image over time
  gsap.to(maskPath, {
    duration: 3, // Duration of path reveal
    ease: "power2.inOut",
    attr: {
      d: "M 0 0 L 1000 0 L 1000 560 L 0 560 Z"  // Final shape of the mask
    }
   // M 0 280 Q 500 800 1000 280 Q 500 -200 0 280
  });

  // Animate the turbulence to reduce its effect, making the image clearer
  gsap.to(turbulence, {
    duration: 3,  // Duration of turbulence effect
    ease: "power2.inOut",
    attr: {
      baseFrequency: 0.001  // Final reduced value of baseFrequency
    }
  });
});


    </script>
